INSERT INTO `quest_template_locale` (`ID`, `locale`, `LogTitle`, `LogDescription`, `QuestDescription`, `AreaDescription`, `PortraitGiverText`, `PortraitGiverName`, `PortraitTurnInText`, `PortraitTurnInName`, `QuestCompletionLog`, `VerifiedBuild`) VALUES
(65775, 'zhCN', '单人策略', '完成15回合单排轮斗。', '你经历了战斗的考验，而且活了下来。\n\n但我觉得这些战斗还有可以提升的空间。再试试看。\n\n你完成后再来找我吧。', '', '', '', '', '', '', 42488),
(65773, 'zhCN', '单打独斗', '完成5回合单排轮斗。', '看来证明你单打独斗的能力的时候到了。\n\n持续不断的冲突带来了机遇，但机遇只能由你自己抓住。有时你必须和敌人并肩作战才能理解他们的战术，而这正是个好机会。\n\n祝你好运。', '', '', '', '', '', '', 42488),
(65772, 'zhCN', '补充必需品', '从开阔草原以及周围区域的元鹰、元鹿和元狼身上收集$1oa份隐匿蛋白质。', '渊誓者的攻击，以及你的到来这两方面的压力让我们的补给捉襟见肘。这件事我很难说出口，但要解决资源短缺的问题，最迅速的方法就是从本地的野生动物身上获得。\n\n事情发展至此的确很不幸，但这件事非做不可。削减本地野外生物的数量，帮助我们补充补给。', '', '', '', '', '', '', 42488),
(65771, 'zhCN', '初诞者的青睐', '在开阔草原上点燃开悟者熏香。', '典狱长部队的攻击就是为了启示我们！过去，我们有同胞寻求过初诞者的禁忌知识。因为他犯下的罪，我们才会承受他们的怒火，也失去了之前拥有的保护屏障。\n\n我们必须为自己同胞的亵渎行为赎罪。\n\n拿上这熏香，前往草原，然后点燃熏香，作为供奉献给初诞者。希望他们能够原谅我们。', '', '', '', '', '', '', 42488),
(65768, 'zhCN', '我们的前哨斥候', '与扎雷殁提斯的前哨斥候交谈。', '典狱长的部队占领了扎雷殁提斯的大片土地，但这里还有别的危险。\n\n我派遣了斥候去调查周围区域，希望他们可以查明任何潜在的威胁。\n\n跟各个斥候谈谈。他们应该都有各自的调查报告。收集完信息后就回来找我。', '', '', '', '', '', '', 42488),
(65749, 'zhCN', '装备的必要性', '收集菲历姆的研究笔记并交给莱菲克。', '一段时间以来，我都跟我的一个同事莱菲克分享我的研究成果。正是通过我们的合作，他才能够获取有用的东西。\n\n请把我最近的研究笔记交给莱菲克，看看你能不能获得他的青睐。他应该很快就能帮你获得更好的装备。', '', '', '', '', '', '把菲历姆的研究交给朝圣者的恩典的长者莱菲克。', 42488),
(65748, 'zhCN', '大有帮助', '在扎雷殁提斯各处的宝箱、巢穴、圣物以及其他容器里发现$1oa份开悟者补给。', '因为初诞者的赐福，以及……许多旅行者的努力，我才能提供装备。\n\n我们每个人都得为后来者提供帮助。\n\n你在扎雷殁提斯探索时，记得收集碰到的补给。看仔细了——它们可能隐藏在神秘莫测的地方。把补给交还给我，我就会把它们提供给将来的旅行者。', '', '', '', '', '', '', 42488),
(65735, 'zhCN', '通缉：库斯托斯', '消灭库斯托斯。', '有个自动体以前很稳定，但现在开始显露出不寻常故障的征兆，它开始攻击朝圣者的恩典外路过的开悟者。\n\n必须保证道路的安全，这对我们的朝圣十分重要。\n\n莱菲克已经提出，将消灭这个威胁作为最紧要的事项。', '', '库斯托斯失控了，正在攻击自己附近的任何东西。', '库斯托斯', '', '', '将成功的消息告诉朝圣者的恩典的莱菲克。', 42488),
(65727, 'zhCN', '隐蔽的元蟾', '从扎雷殁提斯各处的元蜂身上收集$1oa份元蜂蜜。', '你停下脚步观察过元蟾吗？\n\n水下潜伏着一只可爱的元蟾，一动不动，非常有耐心。睿智的巴德跟他很像。我感觉巴德很想凑近仔细看这只巨大的元蟾。\n\n也许我们可以用扎雷殁提斯本地的元蜂的蜂蜜把这只生物引诱出来。你可以去收集一些吗？', '', '', '', '', '', '', 42488),
(65726, 'zhCN', '隐蔽的元蟾', '', '', '', '', '', '', '', '', 42488),
(65725, 'zhCN', '隐蔽的元蟾', '', '', '', '', '', '', '', '', 42488),
(65674, 'zhCN', '这是什么玩意？', '将未成形的精华带给流亡洞穴的菲历姆。', '<你手中模糊的精华似乎可以用来做很多事情。事实上，它仿佛在散发着各种可能性。>\n\n<也许菲历姆对此有自己的答案。>', '', '', '', '', '', '与流亡洞穴与菲历姆交谈。', 42488),
(65625, 'zhCN', '典狱长的挑战', '在托加斯特大厅进入新的传送门。', '噬渊行者！我一直在等你呢。\n\n听说典狱长的部队又开始在托加斯特集结了。我不知道他们想做什么，但肯定没好事。\n\n也许你可以终结他们的计划？', '', '', '', '', '', '', 42488),
(65517, 'zhCN', '企鹅之魂', '把企鹅之魂带给森林之心中的丘法。', '<企鹅之魂好奇而友善。你将掌握企鹅形态。>', '', '', '', '', '', '把企鹅之魂带给森林之心中的丘法。', 42488),
(65516, 'zhCN', '绵羊之魂', '把绵羊之魂带给森林之心中的丘法。', '<绵羊之魂冷静而坚韧。你将掌握绵羊形态。>', '', '', '', '', '', '把绵羊之魂带给森林之心中的丘法。', 42488),
(65515, 'zhCN', '猪之魂', '把猪之魂带给森林之心中的丘法。', '<猪之魂好奇而顽强。你将掌握猪形态。>', '', '', '', '', '', '把猪之魂带给森林之心中的丘法。', 42488),
(65514, 'zhCN', '犰狳之魂', '把犰狳之魂带给森林之心中的丘法。', '<犰狳之魂谨慎而强韧。你将掌握犰狳形态。>', '', '', '', '', '', '把犰狳之魂带给森林之心中的丘法。', 42488),
(65513, 'zhCN', '跃足兽之魂', '把跃足兽之魂带给森林之心中的丘法。', '<跃足兽之魂充满活力，而且十分好奇。你将掌握跃足兽形态。>', '', '', '', '', '', '把跃足兽之魂带给森林之心中的丘法。', 42488),
(65510, 'zhCN', '雷龙之魂', '把雷龙之魂带给森林之心中的曼恩女士。', '<雷龙之魂忠诚而勇敢。你将掌握雷龙形态。>', '', '', '', '', '', '把雷龙之魂带给森林之心中的曼恩女士。', 42488),
(65509, 'zhCN', '蝙蝠之魂', '把蝙蝠之魂带给森林之心中的曼恩女士。', '<蝙蝠之魂狡诈而迅捷。你将掌握蝙蝠形态。>', '', '', '', '', '', '把蝙蝠之魂带给森林之心中的曼恩女士。', 42488),
(65508, 'zhCN', '陆行鸟之魂', '把陆行鸟之魂带给森林之心中的曼恩女士。', '<陆行鸟之魂灵敏而好奇。你将掌握陆行鸟形态。>', '', '', '', '', '', '把陆行鸟之魂带给森林之心中的曼恩女士。', 42488),
(65507, 'zhCN', '雷象之魂', '把雷象之魂带给森林之心中的曼恩女士。', '<雷象之魂聪明而威猛。你将掌握雷象形态。>', '', '', '', '', '', '把雷象之魂带给森林之心中的曼恩女士。', 42488),
(65506, 'zhCN', '鳐鱼之魂', '把鳐鱼之魂带给森林之心中的曼恩女士。', '<鳐鱼之魂聪明而迅捷。你将掌握鳐鱼形态。>', '', '', '', '', '', '把鳐鱼之魂带给森林之心中的曼恩女士。', 42488),
(65505, 'zhCN', '蝎子之魂', '把蝎子之魂带给森林之心中的曼恩女士。', '<蝎子之魂凶猛而贪食。你将掌握蝎子形态。>', '', '', '', '', '', '把蝎子之魂带给森林之心中的曼恩女士。', 42488),
(65504, 'zhCN', '龙鹰之魂', '把龙鹰之魂带给森林之心中的曼恩女士。', '<龙鹰之魂迅捷而强韧。你将掌握龙鹰形态。>', '', '', '', '', '', '把龙鹰之魂带给森林之心中的曼恩女士。', 42488),
(65466, 'zhCN', '你的第一个赋格源锁', '完成赋格源锁。', '为了帮我研究，你得解开各种元尊密文，比如赋格源锁。这是种非常困难的密文，我来让你看看你需要做什么。', '', '', '', '', '', '', 42488),
(65461, 'zhCN', '你的第一个中音源锁', '完成中音源锁。', '为了帮我研究，你得解开各种元尊密文，比如中音源锁。现在，我来让你看看你需要做什么。', '', '', '', '', '', '', 42488),
(65460, 'zhCN', '你的第一个声乐源锁', '完成声乐源锁。', '噬渊行者，看来波可波克已经学会了物拍词技能。这样你就能和造物宝箱互动了。你可以在扎雷殁提斯各地发现好几种这类宝箱。\n\n为了帮我研究，你得解开各种密文，比如声乐源锁。\n\n现在，我来让你看看你需要做什么来帮助我。', '', '', '', '', '', '', 42488),
(65456, 'zhCN', '失联已久的菲历姆', '帮助菲历姆打开大门，进入扎雷殁提斯。', '你的传送门打开时，我正在这儿收集数据。产生的扰动激活了大门锁定机制。\n\n快去收集大门钥匙，这是你应尽的责任，对吧？你搜索的过程中我们可以聊聊。', '', '', '', '', '', '', 42488),
(65432, 'zhCN', '深入研究：中调语', '在流亡洞穴中进一步调查密文控制台。', '<控制台嗡鸣着奇怪的能量。>', '', '', '', '', '', '', 42488),
(65431, 'zhCN', '深入研究：前调语', '在流亡洞穴中进一步调查密文控制台。', '噬渊行者，你取得了一些惊人的发现，但还有很多秘密等待着揭开。\n\n通过解锁控制台，你已经迈出了第一步。我相信你已经准备好迈出第二步了。\n\n请去调查控制台，看看法则向你展现了什么新信息。', '', '', '', '', '', '', 42488),
(65425, 'zhCN', '萨亚德包你满意', '与暴风城的拉凡德鲁斯·虚空之心交谈，调整召唤魅魔法术。', '作为主人，您肯定明白，我在……满足癖好这方面……很能灵活变通。\n\n<恶魔对自己比划着手势。>\n\n如果您不好这口，我也可以只用一种外观，就是可以一直萦绕您的梦境的那种。您的一位导师可以教您如何调整召唤仪式。\n\n当然，您也可以让我做主……嗯，我保证不管怎么样，都会给您一段快乐时光。', '', '', '', '', '', '', 42488),
(65424, 'zhCN', '萨亚德包你满意', '与奥格瑞玛的卡扎克·暗哮交谈，调整召唤魅魔法术。', '作为主人，您肯定明白，我在……满足癖好这方面……很能灵活变通。\n\n<恶魔对自己比划着手势。>\n\n如果您不好这口，我也可以只用一种外观，就是可以一直萦绕您的梦境的那种。您的一位导师可以教您如何调整召唤仪式。\n\n当然，您也可以让我做主……嗯，我保证不管怎么样，都会给您一段快乐时光。', '', '', '', '', '', '', 42488),
(65410, 'zhCN', '费解现实', '', '', '', '', '', '', '', '', 42488),
(65407, 'zhCN', '图像识别', '', '', '', '', '', '', '', '', 42488),
(65406, 'zhCN', '线索汇集', '', '', '', '', '', '', '', '', 42488),
(65360, 'zhCN', '结构图再同化：恐吓元蛇', '向一台合适的原生体锻炉出示结构图。', '<该结构图包含了一种全新原生体构造的图样。向一台合适的原生体锻炉出示，它或许就能将这种动物实例化。>', '', '', '', '', '', '向扎雷殁提斯的一台合适的原生体锻炉出示结构图。', 42488),
(65356, 'zhCN', 'Tracking Quest', '', '', '', '', '', '', '', '', 42488),
(65324, 'zhCN', '法则中的法则', '通过完成世界任务、每日任务、拾取宝藏、消灭稀有生物，援助你在扎雷殁提斯的盟友。', '我们脚下便是暗影界的起源，不能让此地成为暗影界的末路。\n\n与我们的新盟友携手共进吧，$n。他们的援助就能决定我们的成败，以及万物的存亡。', '', '', '', '', '', '', 42488),
(65305, 'zhCN', '前进之路', '返回安谧港的大领主伯瓦尔·弗塔根处。', '看来你有一位新朋友了，噬渊行者！\n\n有了波可波克在身边，你还能发现多少扎雷殁提斯的奥妙呢？我们发现的秘密会在对抗典狱长时派上大用，也许还能教我们如何唤醒这个先知。\n\n大领主伯瓦尔肯定想听闻此事。\n\n快去安谧港告诉他。你可以使用洞穴外面的传送器。\n\n我就留在这里照看先知。', '', '', '', '', '', '与安谧港的大领主伯瓦尔·弗塔根谈一谈。', 42488),
(65271, 'zhCN', '建立联系', '进入安谧港，与开悟者见面。', '菲历姆对这些掮灵开悟者的评价不太积极。而他自己看上去也……举止怪异。\n\n不管怎么样，如果我们要与奥利波斯的战友们重新取得联系，一起击败典狱长，就必须招募扎雷殁提斯当地的盟友。\n\n渊誓者似乎正在安谧港的门外集结。我们不能让更多无辜者惨遭典狱长的毒手了。\n\n希望开悟者能够欢迎我们前来帮忙。你先请，朋友。', '', '', '', '', '', '', 42488),
(65262, 'zhCN', '拯救元袋熊', '', '', '', '', '', '', '', '', 42488),
(65256, 'zhCN', '咯哒轰隆', '使用运动微型生物重校器，“重新校准”开阔草原上的出故障的元鸡。', '入侵者对扎雷殁提斯的元鸡产生了不当影响。\n\n对那些出故障的元鸡使用这个设备，否则它们就会对土地造成过多的破坏。', '', '', '', '', '', '', 42488),
(65234, 'zhCN', '倍感甜蜜', '', '', '', '', '', '', '', '', 42488),
(65232, 'zhCN', '灭虫行动', '', '', '', '', '', '', '', '', 42488),
(65230, 'zhCN', '机器植物人', '', '', '', '', '', '', '', '', 42488),
(65177, 'zhCN', '盛放之果', '在化生园林中收集化生瓜的种子，并消灭蔓生植物。', '我们没法知道创造与能量的汇集能够产生什么新鲜事物来。\n\n化生园林孕育出了新的果实，它们的种子也许带有独特的性质，我们想要了解它们。\n\n请收集你能找到的种子，并让园林更安全一点。', '', '', '', '', '', '', 42488),
(65152, 'zhCN', '坚实羁绊', '', '', '', '', '', '', '', '', 42488),
(65149, 'zhCN', '调查密文', '在扎雷殁提斯寻找索引控制台。', '扎雷殁提斯各地还散布着许多类似的控制台。\n\n它们都超越了我的理解，但也许那个生物企图向我们展示自己的意义？\n\n幸运的是，我知道哪里还有更多。我会在你的地图上标出来，然后陪你一起去……都是为了科研嘛。\n\n让我们看看这个生物究竟有何使命。', '', '', '', '', '', '', 42488),
(65142, 'zhCN', '传送门把戏', '收集$3oa份窥探之眼研究数据。', '为了辅助研究，我使用了一套旅行传送门网络，在扎雷殁提斯各地安装了监控设备。\n\n我的设备成功收集到了大量研究数据，该将它们获取的数据取回来了。\n\n使用我的传送门网络，找到窥探之眼，回收它们采集到的数据。我会给你一个传送门引发器，就算你走丢了，也能重新进入传送门网络。', '', '', '', '', '', '', 42488),
(65102, 'zhCN', '死鱼眼', '', '', '', '', '', '', '', '', 42488),
(65089, 'zhCN', '呱了', '', '', '', '', '', '', '', '', 42488),
(65072, 'zhCN', '高危职业', '协助菈娜搜索，并收集$2oa个元尊圣物。', '菈娜在恒远碎片发现的元尊圣物在开悟者中引发了不小的波动。这些圣物比我们之前的发现还要古老，有了它们，我们或许就能更深入地理解扎雷殁提斯的造物。\n\n菈娜正在收集圣物，但她可能身陷险境了。那片区域中已经出现了赛财团特工的身影，他们很可能妄图窃取圣物。\n\n请赶往恒远碎片，帮助菈娜收集圣物。', '', '', '', '', '', '', 42488),
(65070, 'zhCN', '我可以养它吗？', '向伊·厄尼泼水。', '噢，不。我对这处神圣之地造成了巨大的破坏。\n\n看，伊·厄尼已经跟你产生了感情。虽然这令我很难过，但你肯定比我更适合照看他。\n\n我们解决这件事后，他就交给你了。\n\n现在我们知道了，至少，维度瀑布有能力改变生物的尺寸。我们再试试吧。', '', '', '', '', '', '', 42488),
(65069, 'zhCN', '平息涡流', '消灭$1oa个伊·厄尼复制体。', '这些小小的伊·厄尼复制体很不友善。\n\n他们是由瀑布的某种效果产生的，并不稳定，你看到他们去哪儿了吗？\n\n必须要在他们伤害其他野生动物前削减他们的数量。这件事就交给你了，我去从瀑布再收集一件样本。', '', '', '', '', '', '', 42488),
(65068, 'zhCN', '磅礴涌流', '使用维度瀑布的瀑布之水进行试验。', '维度瀑布的许多生物都被环境影响了。唔……我们就拿瀑布本身做实验吧！\n\n我们在扎雷殁提斯看到了各种自然成分的独特效果。所以水是不是也有独特的作用？\n\n收集一些水，然后泼洒到瀑布的生物上，看看会发生什么。', '', '谁知道这些水会产生什么效果呢？', '伊·厄尼', '', '', '', 42488),
(65067, 'zhCN', '掮灵容器', '从维度瀑布附近的食肉的元鹿处取回组件烧杯。', '在你来这儿之前，我正在自己做实验。\n\n测试……不太顺利。事实证明，一些环境组件会激怒生物，将最温顺的动物转化成猎食猛兽。\n\n我抛下组件容器就跑了，也不记得丢在了哪里。\n\n烧杯肯定就在食肉的元鹿群中。如果花不起作用，我们的下一轮测试就需要那个容器。', '', '', '', '', '', '', 42488),
(65066, 'zhCN', '芳香花卉', '在维度瀑布附近使用多彩元蔷薇进行试验。', '我们在了解到效果之前，也许还是不应该拿伊·厄尼做实验。\n\n继续使用剩下的元蔷薇。我们可以多做些实验。瀑布附近有些生物要比别的更温顺一些，适合这类的实验。\n\n看看不同的生物对元蔷薇的香气会不会有多种多样的反应。', '', '', '', '', '', '', 42488),
(65064, 'zhCN', '看我找到了什么！', '在维度瀑布附近取回$2oa个多彩元蔷薇。', '看看这美妙的生物！\n\n西洛说，我们没有资源提供给我的又一只“异常宠物”。\n\n但我们可以对伊·厄尼进行改造，这样我就能养他了。生物与这里的环境会产生奇怪的互动，也许我们可以把他变小点。\n\n我知道有个地方可以供我们进行研究。附近有种叫多彩元蔷薇的花，也许可以触发反应。你要不要顺路收集一些？', '', '', '', '', '', '', 42488),
(65023, 'zhCN', '冰虫之魂', '把冰虫之魂带给森林之心中的曼恩女士。', '<冰虫之魂凶猛而坚定。你将掌握冰虫形态。>', '', '', '', '', '', '把冰虫之魂带给森林之心中的曼恩女士。', 42488),
(64974, 'zhCN', '自动体走廊清扫', '', '', '', '', '', '', '', '', 42488),
(64958, 'zhCN', '集结部队', '与扎雷殁提斯的长者克勒斯交谈。', '幸好你活着来到了扎雷殁提斯。我不小心听到裴拉戈斯跟克雷雅说，你们的这次旅程非同寻常。\n\n这些掮灵开悟者可以成为宝贵的盟友，他们对自动体和这片土地的了解可以帮助我们对抗典狱长。\n\n我们的部队已经集结完毕，随时可以跟你前往扎雷殁提斯。\n\n最终之战迫在眉睫，$p。', '', '', '', '', '', '', 42488),
(64957, 'zhCN', '重走老路', '打开前往奥利波斯的道标石。', '典狱长撤回了部队。我本该感到欣慰，但这恐怕意味着他找到了进入圣墓的办法。\n\n<长者亚莱颤抖不止。>\n\n虽然长者克勒斯疑心重重，你依然证明了自己是忠实的盟友，我们的依靠。\n\n探险队抵达扎雷殁提斯时，我们发现了一块休眠的道标石。如果你确实就是噬渊行者，预言告诉我们，你能够激活它。\n\n如果你的盟友能拯救这块圣地，那就必须为他们开启道路。\n\n来吧。', '', '', '', '', '', '与大领主伯瓦尔·弗塔根交谈。', 42488),
(64953, 'zhCN', '保护安谧港', '在开阔草原击败$1oa个渊誓者。', '渊誓者已经在我们的门口集结了大军，他们显然想要侵占我们的家园！\n\n开悟者只愿安宁地供奉初诞者的奇迹。安谧港的防御屏障只能将较小的威胁拒于门外，我们可没想到典狱长会派来一整支军队。\n\n你说自己是我们的盟友，凡人？那就帮我们守护这片圣地。', '', '', '', '', '', '', 42488),
(64952, 'zhCN', '毁灭者的覆灭', '摧毁$1oa个噬渊毁灭者。', '渊誓者拥有一些恐怖的武器，能够积聚黑暗的魔法，再将它掷向我们的大门。\n\n安谧港附近的防御屏障支撑不了太久。我们的一切，我们所珍视的事物，很快就会被彻底抹灭。\n\n如果你真有自己声称的那么厉害，那就向我们证明吧。摧毁敌人的武器，帮我们守护家园。\n\n我向初诞者祈祷，但愿你能成功。', '', '', '', '', '', '', 42488),
(64951, 'zhCN', '安谧港之路', '与菲历姆一同离开源生贮藏所。', '我没想到会在今天遇到一个活着的凡人，还有一名格里恩。但你们的援助令我感激不尽。\n\n在我开始研究这个自动体核心之前，我会带领你们前往安谧港。这是我的探险队在抵达此地后建立的居住地。\n\n虽然同事们用质疑“开悟”教条的罪名流放了我，可我也不希望看到典狱长将安谧港永远抹除。\n\n你如果能想办法协助他们，他们就会向你的盟友伸出援手，来而不往非掮灵嘛。', '', '', '', '', '', '', 42488),
(64950, 'zhCN', '互利共赢', '使用自动体之手激活自动体控制台，获取贮藏所珍宝。', '我们不过是挪用了自动体的手，它的同僚们好像很不待见我们，一个个起了敌意。\n\n很遗憾，我们的进度不能因此受挫。\n\n自动体的手可以激活源生贮藏所的一座控制台，它肯定储藏了一件强大的物品。\n\n你把它拿到手，我就指引你去一个地方，那里可能有途径帮你联系到失散的盟友。\n\n我们达成一致了吗？', '', '', '', '', '', '', 42488),
(64949, 'zhCN', '出于研究目的', '从源生前庭的警惕的自动体身上收集$1oa个完好无损的自动体碎片。', '在扎雷殁提斯的这段日子里，我费了好大的力气，尽量不去干扰自动体。所以它们没怎么注意到我。\n\n不过最近的事件好像改变了现状。\n\n再让我澄清一次，我绝对无意伤害初诞者的造物。但是，如果在你的求索过程中，与自动体产生了不可避免的矛盾冲突，我们就必须确保冲突能结出善果。\n\n如果我能检查陨落自动体的碎片，也许就能获得对抗渊誓者的知识。\n\n小心前进。', '', '', '', '', '', '', 42488),
(64947, 'zhCN', '助我一臂之力', '协助菲历姆。', '要将典狱长赶出扎雷殁提斯，我们就要投入所有资源来对抗敌人。\n\n附近的贮藏所里有一件强大的物品，但设施的防御系统只会对自动体做出响应。我绝对不会伤害它们，但我遇到了一台已经无法运转的自动体。\n\n如果你能拆下它的手，我们就能使用失效的附肢进入贮藏所。\n\n这样使用初诞者的造物确实不太体面，但我们总不能放任渊誓者留在这里吧？', '', '', '', '', '', '', 42488),
(64945, 'zhCN', '异乡异邦人', '陪同裴拉戈斯探索周围的环境。', '我们……来到扎雷殁提斯了？而且我们在水面上行走？\n\n多么奇妙的地方！至少从这片迷雾中看起来很奇妙。\n\n我看到远处依稀有一座建筑，也许我们可以在那里找到答案。', '', '', '', '', '', '', 42488),
(64944, 'zhCN', '仓促启程', '骑上心能浮龙，开始前往扎雷殁提斯的旅程。', '前往扎雷殁提斯的通路已经开启。\n\n我们必须暂时分别了，因为我们永恒者不得重返诞生之地。佐瓦尔此举忤逆了元尊最神圣的律法。\n\n你只能孤身踏上这段旅程了。\n\n去吧，在扎雷殁提斯建立落脚点，我们才能将盟约部队派遣过去。\n\n随后我们将追上典狱长，终结他的疯狂行为。', '', '', '', '', '', '', 42488),
(64942, 'zhCN', '兵主的召唤', '与奥利波斯的塔尔-伊纳拉交谈，前往仲裁官密室。', '虽然我们在统御圣所中拼死阻止典狱长，但最终还是失败了。他让噬渊笼罩了奥利波斯，击倒了仲裁官，还打通了前往扎雷殁提斯的道路。\n\n我们现在必须紧追不放。\n\n我们将在仲裁官密室中铸就自己的道路。\n\n快，噬渊行者。暗影界和彼岸万千国度的命运，如今危在旦夕。', '', '', '', '', '', '与兵主交谈。', 42488),
(64867, 'zhCN', '来自开悟者的补给', '与扎雷殁提斯安谧港的瓦伊罗交谈。', '对，我一直都很期待这个时刻！\n\n来吧，来我这儿看看，我们可以一起分享这项成就。\n\n我给你专门准备了特别的惊喜。', '', '', '', '', '', '', 42488),
(64861, 'zhCN', '凯斯梅特里之盘', '将物品交给菲历姆。', '<菲历姆也许可以利用这件物品。>', '', '', '', '', '', '', 42488),
(64860, 'zhCN', '以太晶格', '将物品交给菲历姆。', '<菲历姆也许可以利用这件物品。>', '', '', '', '', '', '', 42488),
(64852, 'zhCN', '万世矩阵', '将物品交给菲历姆。', '<菲历姆也许可以利用这件物品。>', '', '', '', '', '', '', 42488),
(64825, 'zhCN', '寻庇安谧港', '和吉安娜与贝恩一起返回安谧港。', '我不知道该说什么了。\n\n我们没办法继续追踪佐瓦尔和安度因了。我会打开返回安谧港的传送门，我们回到那里再从长计议吧。', '', '', '', '', '', '', 42488),
(64824, 'zhCN', '锻炉之战', '与吉安娜一同前往冥世锻炉。', '我们尽快赶了过来。有人在这片土地中间叫做冥世锻炉的设施附近发现了安度因。\n\n典狱长肯定很快就会与他会合，我们必须立即启程。', '', '', '', '', '', '', 42488),
(64823, 'zhCN', '双身对决', '在思维之环寻找渊誓者的踪迹。', '我总觉得某些地方不太对劲。根据你的报告，这似乎是我们军队内部发起的蓄意破坏……或者又是恐惧魔王捣的鬼。\n\n如果连恐惧魔王都参与了这件事，那方尖碑肯定危在旦夕！快赶去那里。我们要是再拖沓下去，可能就要追悔莫及了！', '', '', '', '', '', '', 42488),
(64822, 'zhCN', '联络脱节', '向三名盟约指挥官重新下达命令。', '莫格莱尼的增援要求很反常。我们已经在计划派出增援了，三队人马已经朝他的方向开拔了。\n\n听起来他们全都未能抵达。你看看能否找到队伍的指挥官，确保他们及时赶到莫格莱尼身旁。', '', '', '', '', '', '', 42488),
(64821, 'zhCN', '万物皆虚', '寻找并消灭$oa个恐惧魔王破坏者。', '我们要对付的是恐惧魔王，他们可以伪装成任何样子……包括扎雷殁提斯的住民。幸运的是，我们有办法驱散他们的幻象。\n\n去野外搜寻一番，测试一下那些自动体。如果你发现了恐惧魔王，就把他们都解决了。', '', '', '', '', '', '', 42488),
(64820, 'zhCN', '谁犯错，谁改过', '修复$oa个防御节点。', '动物供给扇区通常是由自动构造体打理的，但现在有报告称，它们已经无法运转了。\n\n根据报告，你需要为干涉那些节点而负责。也就是说，修理也应该由你负责。带上这个调试器，用它就行了——修好它们之后，你就别再插手了。', '', '', '', '', '', '', 42488),
(64818, 'zhCN', '必需增援', '与安谧港的伯瓦尔·弗塔根交谈。', '那些恐惧魔王已经深深地渗透了我们的队伍。伯瓦尔肯定知道这是怎么回事。\n\n我不能离开这里的岗位。快，去给他报信。开悟者议会可能也有一些见解。', '', '', '', '', '', '', 42488),
(64817, 'zhCN', '洞彻先机', '在植物供给扇区保卫方尖碑。', '那个声音！是从植物供给扇区方尖碑的方向传来的！\n\n这不可能，我们没让任何人溜过去！快，$n！跟我来！', '', '', '', '', '', '', 42488),
(64815, 'zhCN', '同生共死', '帮助$oa个盟约部队成员。', '四大盟约正在此地与自动体合作。\n\n不幸的是，有些士兵与队伍失散了，或者因为负伤而无法归队。\n\n如果你能帮助他们，就能够极大改善战局。', '', '', '', '', '', '', 42488),
(64814, 'zhCN', '锻炉争夺战', '消灭$oa个渊誓者。', '我们的部队正在苦苦支撑，但依然没有占领这片地区。我们需要一些援军来削减敌人的数量。\n\n这个任务对你来说肯定是小菜一碟，噬渊行者。', '', '', '', '', '', '', 42488),
(64797, 'zhCN', '和声与噪音', '与地貌供给扇区的达里安·莫格莱尼交谈。', '这些方尖碑可能就是佐瓦尔图谋的关键。虽然我们并不完全了解它们的作用，但还是不能让它们落入渊誓者手中。\n\n我会将这个消息告诉大领主伯瓦尔。你快去转告达里安·莫格莱尼吧，他也需要相应地做好防御计划。', '', '', '', '', '', '', 42488),
(64796, 'zhCN', '大浪淘沙', '与珊蒂斯·羽月一同侦查地层供给扇区。', '我们目前还没有发现敌人的任何情报，必须抵近他们再作观察。\n\n只要你下令，我就能隐藏我俩的身形。但一定要避开那些恐惧魔王，他们的目光敏锐无比，就连我这样的女猎手也会无处藏身。', '', '', '', '', '', '', 42488),
(64794, 'zhCN', '知己知彼', '在地层供给扇区和珊蒂斯碰面。', '$n，你应该和珊蒂斯一起渗透东部的渊誓部队。不管你们能找回什么情报，都能帮助我们决定后续的行动。\n\n要小心，我们不知道你们会遭遇什么。', '', '', '', '', '', '', 42488),
(64785, 'zhCN', '覆草故事', '检查盖亚迦提克和$3oa个地质元素，获取研究数据。', '自从我们到达此地，不羁芳绿就是一个未解之谜。葱郁的植被在区域中的所有物体上滋长，其中的生物则漫无目的地四处游荡。\n\n这些生物或许能提供宝贵的研究数据。\n\n使用压制陷阱制服元素生物。只要制服了它们，你就能收集研究数据了。', '', '', '', '', '', '', 42488),
(64771, 'zhCN', '开悟离乡', '与安谧港一带的开悟者交谈。', '你好，我的朋友！\n\n很久很久以前，艾财团派出了一支探险队，前去搜寻这个地方。大家都认为他们失踪了。我来到扎雷殁提斯，就是希望赶在噬渊的威胁蔓延开之前，挽救我那四分五裂的财团。\n\n最终，我找到了昔日的老友！结果她不肯返回安全地带。\n\n也许其他人愿意听劝，你能去试试吗？', '', '', '', '', '', '', 42488),
(64760, 'zhCN', '技术疑难', '按下沉眠宝库的控制台上的按钮。', '控制台失控了！我们必须修复它！\n\n也许这些按钮能发挥作用？', '', '', '', '', '', '', 42488),
(64758, 'zhCN', '追逐领袖', '调查沉眠宝库。', '我们初次抵达时封锁了通往沉眠宝库的大门。那里可是圣地，是这里所有宝贵之物的摇篮，在其中沉睡的力量决不能为我们所触碰。\n\n如果我们光顾着欣赏此地的美景，让赛财团的领袖穿过了护盾，我真不敢想象他们会惊扰到什么样的东西。\n\n快！我们必须赶去沉眠宝库，确保那里安然无恙。', '', '', '', '', '', '', 42488),
(64744, 'zhCN', '掮灵显隐师', '在安谧港外消灭$1oa个赛财团特工。', '你有没有感觉到到空气里有什么不一样了？赛财团或许是躲了起来，但他们肯定就在这附近。\n\n幸运的是，我很熟悉他们用来掩藏行踪的设备。这个给你，把它放在地上，附近的特工就会显形……一阵子。\n\n你必须阻止他们，就算夺走他们的性命也没关系。', '', '', '', '', '', '', 42488),
(64743, 'zhCN', '赛何居心？', '收集$1oa份可疑的纸。', '虽然我们看不见，但赛财团肯定把据点设在了这里。\n\n某种东西将赛财团引到了扎雷殁提斯的这片区域。我们只有查个水落石出，才能保护好本地的朋友。\n\n他们的伪装没能将补给品全部藏好，你也许能从他们的物品中有所收获。', '', '', '', '', '', '', 42488),
(64742, 'zhCN', '干涉的踪迹', '寻找赛财团出没的线索。', '护盾被破坏了。想都不用想，无情无义的赛财团肯定会率先尝试用这片土地牟利。\n\n他们的贪婪令我们陷入了巨大的危机，必须阻止他们。我们要一起寻找他们的行踪。', '', '', '', '', '', '', 42488),
(64741, 'zhCN', '安保检查', '调查安谧港附近的护盾导体。', '我不明白——这些可都是我的同胞啊！赛财团和噬渊部队都出现在大门口了，他们怎么还是那么粗枝大叶？\n\n他们的防护技术都是老古董了，没法将危险挡在门外。如果我没法劝他们离开，我至少可以保证他们能够安全地呆在自己不想离开的地方。\n\n我可不想再失去一次朋友了。\n\n护盾的边缘附近应该有四个隐藏的导体。带上这些工具，它能让你检查导体，如果需要的话，也可以进行加固。', '', '', '', '', '', '', 42488),
(64717, 'zhCN', '造物材料', '收集$1oa份幻灵碎片和$2oa份次级秘珠。', '散落在扎雷殁提斯各地的大型金属球体都是用过的锻炉，它们在造物过程中遭到了废弃。\n\n冥世锻炉附近的球体包含了微量该地区独有的材料。\n\n我改造了我的熔炉阀门，能够采收这种材料。到我标出的锻炉附近使用它吧，在最大的几个元尊锻炉附近找到稀罕的幻灵碎片的几率最大。', '', '', '', '', '', '', 42488),
(64230, 'zhCN', '初诞者的密文', '调查密文控制台。', '前路仍不明了，但已踏出步伐。\n\n看来在你我之间，神圣的构造体更青睐于你。\n\n既然它带你走上了领悟之路，不妨看看它还想向你揭示什么。\n\n最终的结果肯定是醍醐灌顶。', '', '', '', '', '', '', 42488),
(64228, 'zhCN', '请开尊口', '和菲历姆讨论先知的情况。', '你确实给我带来了一位先知！还是完好无缺的！\n\n我从没想过这种神圣的存在愿意和自动体之外的个体对话。我们可以从她这里了解扎雷殁提斯的方方面面。\n\n你必须一五一十地告诉我！', '', '', '', '', '', '', 42488),
(64227, 'zhCN', '隐匿的访客', '消灭流亡洞穴附近的刺客。', '自从你打开了奥利波斯的通路，某些财团就抓住了机会， 想找到我和我的工作成果……还用上了足以致命的手段。他们很清楚，我的研究对万事万物都至关重要。\n\n肯定会有更多刺客循迹而至，而你就是那个给他们带路的人！\n\n我没法把他们挨个解决，你必须摆平这个问题，保护我的秘密。\n\n替我搞定他们吧。', '', '', '', '', '', '', 42488),
(64226, 'zhCN', '安保措施', '使用感官同步器，在流亡洞穴附近重置$2oa个触发的陷阱。', '你们大摇大摆地闯进了我家，看来我在岩洞周围布置的隐匿陷阱效果一般。\n\n不过嘛，它们还是有些用处的，至少能避免大部分不速之客上门叨扰。\n\n既然你们好心地招来了刺客，我就没法亲自重置陷阱了。\n\n我需要在这里保护好自己，看管宝贵的研究成果。而你必须为我代劳。使用我在附近安装的感官同步器，你就能知道哪里的陷阱需要重置。', '', '', '', '', '', '', 42488),
(64225, 'zhCN', '找寻菲历姆', '找到菲历姆。', '你有发现了？太走运了！能让我看看那封信吗？\n\n看来，有个叫泽威斯的开悟者听说过，菲历姆最后一次现身是在冥世锻炉的西边，然后他动身去找菲历姆了。\n\n我们应该从那里开始找。', '', '', '', '', '', '', 42488),
(64224, 'zhCN', '寻觅未知', '在安谧港搜寻关于菲历姆的信息。', '既然长者不愿协助我们，那我们就去寻找愿意的人。\n\n那个叫菲历姆的开悟者，他对自动体兴致勃勃。\n\n他说自己跟同胞们关系很疏远。安谧港里肯定有人知道他的事情。\n\n在营地里转转，找找菲历姆去向的线索。我会想办法劝长者们提供情报。', '', '', '', '', '', '', 42488),
(64223, 'zhCN', '核中之核', '和安谧港的长者克勒斯交谈。', '她虽然倒下了，但看起来一息尚存。我们肯定能找到帮助她的办法。\n\n也许开悟者知道些什么。我会想办法把她带回去，我们到安谧港再见吧。', '', '', '', '', '', '', 42488),
(64219, 'zhCN', '谜之声', '进入初生摇篮。', '吞噬者们贪得无厌，造成了数不胜数的破坏。\n\n希望我们刚才听到的生物没有身负重伤。\n\n这扇门没法正常开启了，也许我们可以强行将其打开！\n\n不管里面有什么，总之它需要我们的帮助！', '', '', '', '', '', '', 42488),
(64218, 'zhCN', '远虑近忧', '调查源生荒野。', '朋友，我们已经对典狱长使出了浑身解数。\n\n还有其他要务需要我们去关心，例如我最近看到，东边开启了许多吞噬者裂隙！\n\n如果不能阻止那群野兽，它们就会在这里肆意破坏。\n\n你能帮我解决它们吗，$n？', '', '', '', '', '', '', 42488),
(64016, 'zhCN', '泥出风采', '在重殴者之台以碎皮兽作为测试目标，帮助乌兹测试成长能力。', '学徒！我一直在找你呢。\n\n在我们的试验中，凯文一直是个尽心尽力的好助手。我想给其他的软泥好好训练一番，让它们也能帮忙！\n\n我想知道乌兹能不能吞噬有机材料并不断长大。', '', '', '', '', '', '', 42488),
(63952, 'zhCN', '巨掌战术', '消灭$1oa个渊誓碎魂者、$2oa个水晶守护者、娜莉丝夫人和玻璃制造者。', '我们的前线需要更多的构造体，但躯干、头或者腿都不够了！\n\n拉萨恩正在用我们现有的东西尽量制作出最好的构造体……手我们倒是有很多。\n\n不准提问！\n\n白垩之地里面有许多敌人，我们得消灭他们。带上这些手，去把他们拍扁！', '', '', '', '', '', '在俯瞰滋长的黑暗的桥头与辛达妮侯爵会面。', 42488),
(63850, 'zhCN', '追踪——小型控制台', '', '', '', '', '', '', '', '', 42488),
(63609, 'zhCN', '科多兽之魂', '把科多兽之魂带给森林之心中的曼恩女士。', '<科多兽之魂冷静而忠诚。你将掌握科多兽形态。>', '', '', '', '', '', '把科多兽之魂带给森林之心中的曼恩女士。', 42488),
(62639, 'zhCN', '强中自有强中手', '通过搜寻战斗功能，以全队25级宠物打败5名玩家。', '星辰的排列真的非常奇怪，它们使得最微小的生物也有了不正常的能力。我们的贤者无法解释这一现象，不过精明的训练师会把握这个机会，尤其是借这段时间与其他同好切磋技艺。', '', '', '', '', '', '', 42488),
(61609, 'zhCN', '工程学：骨片之锥发射器', '', '', '', '', '', '', '', '', 42488),
(61342, 'zhCN', '久远的胜仗', '', '', '', '', '', '', '', '', 42488),
(60932, 'zhCN', '唯有暗影留存', '在黑暗大教堂击败传令官达罗拉。', '我们虽然还不知道这个黑暗传令官为谁效命，但很明显，她带来的消息让天灾和诅咒教派变得有恃无恐了。\n\n不能让这种情况再继续下去了。我们必须消灭她，给她主人手下的新仆从送上致命的一击。\n\n带头冲锋吧，$p。银色北伐军会与你同在。\n\n以圣光的意志，我们现在就要结束这种疯狂。', '', '一个来历不明的黑暗身影，笼罩在低语的暗影中。', '传令官达罗拉', '', '', '', 42488),
(59905, 'zhCN', '奇怪的箱子', '', '', '', '', '', '', '', '', 42488),
(56904, 'zhCN', '繁荣花冠', '从安戈洛环形山、荆棘谷和北贫瘠之地中采集花朵。', '你的花冠颜色非常鲜艳。粉色，黄色，蓝色……如果它们能够长久就更好了。\n\n虽然这些花朵不能长久，但是我知道一些能够长久的花朵！\n\n它们会在新年期间出现。多亏了你的努力，它们与艾露恩之间建立了特殊的联系，我可以以此对它们进行强化。帮我收集一些花朵，我就能为你制作一个一年都不会凋零的花冠！', '', '', '', '', '', '返回月光林地寻找迈瑞尔·月华。', 42488),
(56903, 'zhCN', '勇气花冠', '在永歌森林、辛特兰和莫高雷收集花朵。', '看来你很喜欢粉花。你的花冠终将枯萎，真令人感到惋惜。\n\n或许我能帮忙。\n\n尽管这些只是一些普通的花朵，我知道一种与之类似的花朵，生长于新年期间。如果你能帮我采来一些，我就能将艾露恩的力量注入其中，令它们能够四季常开。', '', '', '', '', '', '返回月光林地寻找迈瑞尔·月华。', 42488),
(54804, 'zhCN', '格勒格勒', '', '', '', '', '', '', '', '', 42488),
(54663, 'zhCN', '暗影猎手沃特里斯', '', '', '', '', '', '', '', '', 42488),
(54349, 'zhCN', '黑海岸捐赠：浪息亚麻绷带', '', '', '', '', '', '', '', '', 42488),
(54340, 'zhCN', '黑海岸捐赠：附魔戒指 - 急速之纹', '', '', '', '', '', '', '', '', 42488),
(54338, 'zhCN', '黑海岸捐赠：热力加速瘟疫扩散弹', '', '', '', '', '', '', '', '', 42488),
(54331, 'zhCN', '黑海岸捐赠：凛冬之吻', '', '', '', '', '', '', '', '', 42488),
(54182, 'zhCN', '锈水豪胆兄弟', '', '', '', '', '', '', '', '', 42488),
(53617, 'zhCN', '疯狂的解脱', '消灭$1oa名狂暴的黑木熊怪。', '部落造成的毁灭让森林的孩子们发疯了。\n\n其中首当其冲的是黑木熊怪。他们已经陷入疯狂，会威胁到所有人。如果不进行处理，他们可能会趁我们的军队与部落交战时从后面偷袭。\n\n光是提出这个要求就已经让我心如刀绞，但我没有办法。你去暮光谷时，请让这些生物从痛苦中获得解脱吧，否则他们可能会伤害到其他人。', '', '', '', '', '', '在古树之林旁边与戴勒琳·夏月队长见面。', 42488),
(53312, 'zhCN', '光亮的白金', '', '', '', '', '', '', '', '', 42488),
(53264, 'zhCN', '阿拉希捐赠：无尽之海鲶鱼', '', '', '', '', '', '', '', '', 42488),
(53261, 'zhCN', '阿拉希捐赠：霜纹弹药', '', '', '', '', '', '', '', '', 42488),
(53252, 'zhCN', '阿拉希捐赠：智力战争卷轴', '', '', '', '', '', '', '', '', 42488),
(53246, 'zhCN', '阿拉希捐赠：镍铜硬化马镫', '', '', '', '', '', '', '', '', 42488),
(53008, 'zhCN', '圣人之智', '', '', '', '', '', '', '', '', 42488),
