(52897, 'zhCN', '摇滚起来', '', '', '', '', '', '', '', '', 42488),
(52234, 'zhCN', '潜于叶下', '找到$1oa名隐藏的利爪德鲁伊。', '部落入侵时，我已尽力抵挡，但我还是不知道有多少兵力已经通过了这里。这堵墙可以减缓他们的脚步，但没法彻底抑制他们的进攻。\n\n<玛法里奥竖起耳朵。>\n\n听见了吗，英雄？古树在呼唤我们！\n\n我们必须不惜一切代价保护它们，$n！它们能感知到我们看不见也听不见的东西。\n\n暮光谷中有我手下的一些德鲁伊，去找到他们，让他们去古树之林。我会在小精灵之墙这里帮忙。', '', '', '', '', '', '在古树之林旁边与戴勒琳·夏月队长见面。', 42488),
(52062, 'zhCN', '灰谷动荡', '前往阿斯特兰纳向戴勒琳·夏月队长报告。', '天杀的部落！我得承认，真是一群机灵的混蛋。他们在贫瘠之地北面的岔路口改变了方向，正在向灰谷行军。\n\n卡多雷部队已经扬帆前往希利苏斯——现在一定在半路上了。此地唯一的防御力量是达纳苏斯城中的卫兵。他们正在前往阿斯特兰纳，但面对一支军队，他们撑不了多久。他们的队长叫戴勒琳·夏月。\n\n去找到她，$n，为我们争取时间。我们会尽快让我们的舰队抵达那里。', '', '', '', '', '', '', 42488),
(51662, 'zhCN', '狐穴飞天魔隼', '', '', '', '', '', '', '', '', 42488),
(51213, 'zhCN', '维克雷斯庄园：无需讲价', '', '', '', '', '', '', '', '', 42488),
(47007, 'zhCN', '法师塔之赐', '', '', '', '', '', '', '', '', 42488),
(44560, 'zhCN', '寻找配方', '收集皇冠药剂公司的配方的其他部分，然后向暴风城的探员斯尼普·滑栓复命。', '皇冠药剂公司似乎正在制造某种合剂，而这就是其中一部分配方。其他部分应该就在附近。', '', '', '', '', '', '', 42488),
(41663, 'zhCN', '凡图斯符文产品订单： 艾乐瑞瑟·雷弗拉尔', '', '', '', '', '', '', '', '', 42488),
(41343, 'zhCN', '坚固的龟壳碎片', '', '', '', '', '', '', '', '', 42488),
(41326, 'zhCN', '产品订单：风暴之鳞', '', '', '', '', '', '', '', '', 42488),
(41283, 'zhCN', '大鱼杀手', '', '', '', '', '', '', '', '', 42488),
(36700, 'zhCN', '鲜血竞技场的挑战', '在鲜血竞技场里参加对决。', '在鲜血竞技场有挑战在等着你。\n\n带上朋友一同前往，证明你的勇士称号是当之无愧的。', '', '', '', '', '', '', 42488),
(36687, 'zhCN', '鲜血竞技场的挑战', '在鲜血竞技场里参加对决。', '在鲜血竞技场有挑战在等着你。\n\n带上朋友一同前往，证明你的勇士称号是当之无愧的。', '', '', '', '', '', '', 42488),
(33025, 'zhCN', 'NC S2 Q2', '', '', '', '', '', '', '', '', 42488),
(32634, 'zhCN', '粉碎防御', '在寻晨者海角附近摧毁6个夺日者监视结界。', '哪怕是最无懈可击的防御也会有薄弱点，$c。我们只需要找到夺日者防线的薄弱点，然后尽可能地加以利用。$b$b据斥候回报，在寻晨者海角四处布满了监视结界。这些结界十分强大，可并不具有致命的杀伤力。$b$b如果能让它们失效，我们就能近距离监视夺日者的行动了。', '', '', '', '', '', '', 42488),
(29413, 'zhCN', '诡异的箱子', '', '箱子几经偷盗、买卖和追寻。凡是打算解开其中封存的魔法之人，都遭到了其力量的反噬。$B$B饶是如此，箱子本身还是毫发未伤，充盈着魔法能量。偶尔，它还会震动一两下子，仿佛其中装着什么活物一般。$B$B貌似它已经同你绑定在了一起，如今是你的东西了。', '', '', '', '', '', '', 42488),
(27060, 'zhCN', '不洁之牛', '护送安度因·乌瑞恩沿着血迹从沃勒顿的农场前往犯罪现场。确保安度因的安全。假如你同他走散了，可以在暴风城王座找到他。', '<沃勒顿试图恢复镇静。>$B$B牛？您是说失踪的牲畜一事？$B$B平常我就将牛放养在房子北边。突然有一只走丢了，留下一道血迹。谁会做那样的事情？$B$B我是不敢沿着血迹去找……暴风城里有些病态的东西！', '', '', '', '', '', '', 42488),
(14409, 'zhCN', '谨慎的回访', '将达罗斯的日记带给身处达纳苏斯的莫丹特·永影。', '占用你一点时间，$c。$b$b世事无常。我们又一次被迫离开了埃雷萨拉斯废墟，走入外面的世界。我是来研究这座城市的，我不想走远，但是也许你会对这个差事感兴趣。$b$b我的同事准备前往达纳苏斯去找那里的高阶祭司谈谈，希望能借此与他们达成共识。带上这本日记去找神殿中的莫丹特·永影。这东西也许会对他的外交任务有帮助。', '', '', '', '', '', '', 42488),
(13383, 'zhCN', '吉普利·基罗赫斯', '首席技师波尔维克要你前往荒凉之门奥尔杜萨上空的联盟隐形机场，并与吉普利·基罗赫斯谈一谈。', '地精们幸运地发现了一种新能量。他们管这种能量叫“绿外线”。怎么说呢……如果这些疯子发现了一种新的金子，而它居然不是绿的，那我都能变成独眼食人魔了。$B$B我要你去找吉普利·基罗赫斯。他在荒凉之门奥尔杜萨上空的一座小型隐形联盟机场上，领导着绿外线的逆向工程研究。我会给你绿外线视界，这样你就可以找到他了。到插着联盟旗帜的那座圆顶上去吧——但是如果你飞到部落的机场附近的话，你就会遇到大麻烦了，而且还是绿色的麻烦。', '', '', '', '', '', '', 42488),
(11454, 'zhCN', '寻找主谋', '在黑石深渊的酒吧中找到科林·烈酒。', '这张便笺似乎是入侵的黑铁矮人不小心留下的。$B$B虽然上面的文字复杂难辨，似乎是以加密的矮人语书写的，末尾的署名倒是清楚得很——“科林·烈酒”，其中还提到了黑石深渊的酒吧。你应该揪出黑铁矮人入侵事件的煽动者，摆平这场骚乱。', '', '', '', '', '', '', 42488),
(10605, 'zhCN', '凯伦丁的召唤', '与幽暗城的凯伦丁·哈加尔谈一谈。', '你似乎对获取知识显得十分饥渴的样子，$n。看来你的学习正好到了一个提升层次的阶段。$b$b去幽暗城与凯伦丁·哈加尔谈谈吧，那把老骨头知道许多歪门邪道，或许你以后的冒险里会用得上。', '', '', '', '', '', '', 42488),
(9489, 'zhCN', '清理死亡之痕', '对死亡之痕的6个永歌游侠施放真言术：韧。', '$n，你能来真是太好了。天灾军团在不断袭击我们的城市，我担心守卫们会丧失士气。$b$b杰拉和她的游侠在南边的死亡之痕严阵以待，你赶紧到那里去，召唤圣光的力量为他们祝福吧。', '', '', '', '', '', '', 42488),
(9435, 'zhCN', '[DEPRECATED] 遗失的水晶', '从被遗忘者手中夺回一箱稀有的水晶，把它交给南海镇的忽尔兰。', '关于希尔斯布莱德，我这里有个真理要告诉你，那就是：这片土地命中注定是要笼罩在战争阴影之下的。即使是一辆装满石头的无害马车，也会成为被攻击的目标。$B$B如果只是丢了一辆装满建筑材料的马车，倒也无伤大雅，可这辆马车上偏偏装有从碧玉矿洞运来的一箱稀有水晶样本，那正是我十分想研究的。被遗忘者的小分队截走了这辆车，把它带去了东北方的一处他们想要重建的哨塔里。回收这些水晶是目前最紧迫的事，$c！', '', '', '', '', '', '', 42488),
(9189, 'zhCN', '送往瑟伯切尔的信', '将密封的辛多雷命令交给银松森林瑟伯切尔的顾问索雷伦。', '你搅得女王心神不宁，虽然她的心早已不再跳动。$B$B我有若干份指令要送往银松森林的瑟伯切尔，顾问索雷伦负责跟那儿的被遗忘者沟通。如果不乘坐蝙蝠的话，前往瑟伯切尔的最快路线是出了幽暗城的城门之后往南走。沿途有路标，应该不难找。打起精神来，瑟伯切尔是座荒芜的墓穴。$B$B那些被遗忘者显然都是些古怪的家伙。', '', '', '', '', '', '', 42488),
(7261, 'zhCN', '国王的命令', '到希尔斯布莱德丘陵地区的奥特兰克山谷去。到那里之后，和哈格丁中尉谈谈。$B$B为了铜须的荣耀！', '我们正在奥特兰克山谷进行一场血腥的战斗，蒙昧的冰斧巨魔和野蛮的霜狼氏族从两边夹击我们。以麦格尼·铜须陛下的名义，我们一定要把他们全都消灭掉！占领那片土地，将敌人赶出去，这对于王国的稳定是非常重要的。$B$B啊，士兵可不是从树上长出来的！向奥特兰克的哈格丁中尉报告，在那里加入雷矛部族的军队，开始履行你光荣的职责吧。', '', '', '', '', '', '', 42488),
(6163, 'zhCN', '吞咽者拉姆斯登', '到斯坦索姆去，杀掉吞咽者拉姆斯登。把他的徽记交给纳萨诺斯。', '我被完全击败了。为了守卫我们的家园，为了守卫洛丹伦，我在这里绝望地战斗着……一切抵抗者都在潮水般的天灾士兵面前被夷为废墟。$B$B那个邪恶而肮脏的怪物把我踏在脚下，我能看到它丑恶的内在。$B$B我被亡灵天灾唤醒了，一直以来，我是如此的无助。我的意志被巫妖王牢牢地控制着。$B$B她赶来解救了我……不管用什么方式，在什么地方，我知道她早晚会这么做的。自由。$B$B现在，我必须进行复仇——对那些夺取我生命的敌人进行复仇。毁灭它。', '', '', '', '', '', '', 42488),
(1302, 'zhCN', '[DEPRECATED] 詹姆斯·海厄尔', '与塞拉摩城堡中的书记员伦德瑞谈一谈。', '我的兄弟詹姆斯跟随吉安娜女士到塞拉摩去了。我最后一次听到他的消息是说他们在那儿打完了仗，詹姆斯还在那里的某个地方开了个旅店。不管他现在在哪儿，我想他的生意肯定很红火，他是个很棒的厨师。$b$b啊，说起来我已经有一阵子没听到他的消息了——旅店的生意太忙了——不过塞拉摩的书记员应该可以帮你找到他。他就在那里的城堡顶楼。', '', '', '', '', '', '', 42488),
(993, 'zhCN', '丢失的主人', '找到沃科尔。', '$n，斗篷做好了。你现在可以去寻找沃科尔，我希望时间还来得及。$B$B斗篷上的魔法被激活之后持续不了多久间，也许就只有五分钟左右的时间。你可以自行决定什么时候使用它，不过我建议你在找到锐爪以后再用。$B$B如果锐爪告诉我的消息是真的，那么你应该可以在南边的某个洞穴中找到他的主人。锐爪会在路边等你，看见它以后向它挥手打个招呼（使用/wave指令），然后它就会将它的主人所在的位置告诉你。', '', '', '', '', '', '', 42488),
(951, 'zhCN', '玛塞斯特拉遗物', '收集6个黑暗深渊遗物，把它们交给古树之林的安努。', '你在主宰之剑找到的那页书来自于一本古籍……一本精灵撰写的古籍。但它已经被暮光之锤诅咒和玷污了，看来暮光之锤的信徒是希望用古代精灵的魔法将他们古老的主人重新召回我们的世界。$B$B到东北边的玛塞斯特拉废墟去看看，找到那些古代的遗物。如果我能研究一下它们的话，也许能搞清楚暮光之锤打算如何使用那些精灵的魔法。', '', '', '', '', '', '', 42488),
(731, 'zhCN', '健忘的勘察员', '在勘察员雷姆塔维尔搜寻神秘化石的时候保护他，然后回到奥伯丁的考古学家霍莉那里。', '好吧，那么，霍莉……哦，不对，你不是霍莉。霍莉去哪儿啦？$b$b不说这个了，那不是我们要讨论的话题。我们必须找到那把石刷……我是说神秘的化石！我们必须找到化石。达纳苏斯的探险者协会希望能看到我的工作进展情况。$b$b如果你准备好了，就和我说一声，我们去寻找那把刷子……我是说化石！我们要找到一些能让协会满意的东西。$b$b你准备好了吗？', '护送勘察员雷姆塔维尔', '', '', '', '', '', 42488),
(633, 'zhCN', '萨多尔大桥', '摧毁堆积的炸药。', '天呀！不！可怜的伊本瑟，这实在是一个悲剧。$b$b我们绝对不能让他就这样白白牺牲了。你发现的这张羊皮纸上写道，是卡姆·深怒在背后组织了这次进攻，并且，他还在萨多尔峡谷的阿拉希高地那一侧囤积了不少炸药。$b$b如果他们用这些炸药摧毁了桥梁的话，那么我们的通向北边的主要补给线就会被彻底切断！必须摧毁这些炸药，$n！完成了这个任务后立刻回来向我复命。$b$b你是我们最后的希望了。', '', '', '', '', '', '', 42488),
(610, 'zhCN', '帅小伙子邓肯', '从“帅小伙子”邓肯那里夺回凯特琳的匕首。', '我老爸派你来的？我还以为那怪老头已经早就放弃掉我了呢。$b$b我之所以离家出走确实不是他的错，他只是不应该为我安排好一条乏味的人生道路，并希望我欣然接受它。我怎么能忍受整天读着那些发霉的书本，整天和那帮灰头发加驼背的乏味老头法师们在一起！$b$b如果你需要我的匕首，你可能得从一个叫“帅小伙子”邓肯的血帆海盗那里夺回来。我想你只要教训教训他，他就会屈服的。', '', '', '', '', '', '', 42488),
(479, 'zhCN', '调查安伯米尔', '为瑟伯切尔的暗影牧师奥利斯特抢到8个达拉然坠饰。', '达拉尔正在尝试着定位出达拉然法师们施法时的能量流向。现在，我们必须要尽我们一切努力来暂缓他们的进程……$b$b那些咒术师、法师和保卫者恐怕会拼死保护坠饰。你必须清除掉这些阻碍，并把饰物抢到手。$b$b沿着大路向南走，在岔路口转向东边就可以到安伯米尔了。', '', '', '', '', '', '', 42488),
(293, 'zhCN', '净化帕雷斯之眼', '把被诅咒的帕雷斯之眼交给大主教本尼迪塔斯，他就在暴风城的光明大教堂里。', '我无法驱散帕雷斯之眼上的诅咒。它是由人类牧师手工制造的，所以你最好去暴风城寻找帮助。去和大主教本尼迪塔斯谈谈吧，他是暴风城光明大教堂的领导者，他能帮你解决问题。$B$B我希望如此。', '', '', '', '', '', '', 42488),
(159, 'zhCN', '僵尸酒', '把僵尸酒交给乌鸦岭墓地北方小屋里的亚伯克隆比。', '这是你要的僵尸酒……$B$B不过要小心一点，这酒烈得足以把死人给呛活过来。', '', '', '', '', '', '', 42488);
